# https://leetcode.com/problems/number-of-substrings-with-only-1s?envType=daily-question&envId=2025-11-16

class Solution:
    def numSub(self, s: str) -> int:
        count = 0
        prev_index = 0
        MOD = 10**9 + 7
        for x in s:
            if x == '0':
                if prev_index:
                    count += (prev_index * (prev_index + 1) // 2) % MOD
                prev_index = 0
            else:
                prev_index += 1
        
        if prev_index:
            count += (prev_index * (prev_index + 1) // 2) % MOD

        return count
    
    # time limit exceeded
    def numSubV1(self, s: str) -> int:
        slen = len(s)
        count = i = 1
        while i <= slen:
            for j in range(slen - i + 1):
                if '0' in s[j:j+i]:
                    continue
                count += 1
            i += 1
        return count-1
    
sol = Solution()
s = "0110111"
s = "101"
s = "111111"
s = ""
print(sol.numSub(s))